Description:
This is a Contract Award Notice (CAN) being published by the Contracting Authority, NHS Mid and South Essex Integrated Care Board (ICB), to communicate a below threshold contract is compliantly awarded to the provider Wavenet, via the Framework Agreement &apos;Crown Commercial Services RM3808&apos;

This contract is for delivery of Corporate IP Telephony between 22nd March 2023 and 30th March 2024 with a potential extension option of 6 months, expiring 30th September 2024.

The aggregate contract value is £183,593 including VAT.

Awarded using Ofwat's Conditions of Contract for Temporary Staff (via Intermediary).

Requirement: Interim Finance Accountant

The Services required are to support the backlog of finance work that has built up whilst the Oracle finance system was implemented. The Finance Team are still low on resource due to the clearing of priority issues on the Oracle system and moving from implementation to stabilisation whilst supporting and training Ofwat business users on Oracle.

The main tasks will include, but not restricted to:

- Whole of Government Accounts preparation and submission;
- Government transparency returns eg Senior manager expenses;
- IAS19 leave accrual calculation;
- Payment Performance calculation and analysis;
- Month 9 interim accounts preparation;
- Balance sheet reconciliations;
- Expenses policy review and update;
- Support for VAT return.
